import './Register.css';
import { createUser } from '../../service.js';
import apis from '../../api/api.js';
import axios from 'axios'

import { Link } from 'react-router-dom';
import { useState } from "react";

function Register() {

    const[email, setEmail] = useState("");
    const[password, setPassword] = useState("");
    const[message, setMessage] = useState("result here");

    const insertUser = () =>  { 
        var user = {
            username: email,
            email: email
        }

        axios.post('http://localhost:3080/server/newuser', user)
            .then(res => {
                console.log(res.data);
                setMessage(res.data.message);
            })
    }

    return(
        <div>
            <form id="login-form" >
                <div class="mb-3">
                    <label class="form-label">Email address</label>
                    <input type="email" class="form-control" required onChange={(event) => setEmail(event.target.value)}></input>
                </div>
                <div class="mb-3">
                    <label for="inputPassword5" class="form-label">Password</label>
                    <input type="password" class="form-control" required onChange={(event) => setPassword(event.target.value)}></input>
                </div>
                <button type="button" class="btn btn-primary mx-auto d-block" onClick={() => insertUser()}>Register</button>
                <p>{message}</p>
                <Link to="/login">Login</Link>
            </form>
        </div>
    )
}

export default Register;
